INSERT INTO `lp_cabeceras` (`id`, `modelo_id`, `nombre`, `titulo`, `descripcion`, `imagen_fondo`, `inicio`, `link`) VALUES
(1, 1, 'VOLVO ALL NEW XC90 MADE BY SWEDEN', 'Elegancia Sueca', 'Un diseño que destila armonía: un lujo puro y sin estridencias, con seguridad avanzada y confort para los 7 ocupantes.', 'xc90_header.jpg', 1, ''),
(2, 2, 'VOLVO XC70 MADE BY SWEDEN', 'Elija su propia aventura', 'Un familiar de lujo con unas prestaciones de altura, perfecto para quienes busquen disfrutar de la aventura sin renunciar a la sofisticación.', 'xc70_header.jpg', 0, ''),
(3, 3, 'VOLVO XC60 MADE BY SWEDEN', 'Siempre como en casa', 'Un coche perfecto para conductores exigentes en busca de aventura, tanto en la selva urbana como en campo abierto.', 'xc60_header.jpg', 0, ''),
(4, 4, 'VOLVO V60 CROSS COUNTRY MADE BY SWEDEN', 'SOLIDEZ Y REFINAMIENTO', 'Una experiencia única al volante, ideal para los amantes del diseño, la naturaleza y la aventura.', 'v60cc_header.jpg', 0, ''),
(5, 5, 'VOLVO V60 MADE BY SWEDEN', 'El viaje es el destino', 'Para quienes necesitan la versatilidad de un familiar, pero suspiran por la potente conducción de un deportivo.', 'v60_header.jpg', 0, ''),
(6, 6, 'VOLVO V40 CROSS COUNTRY MADE BY SWEDEN', 'El mejor socio para la escapada perfecta', 'Un compacto más alto y con un diseño preparado para emociones fuertes. Ideal para lanzarse de cabeza a la aventura.', 'v40cc_header.jpg', 0, ''),
(7, 7, 'VOLVO V40 MADE BY SWEDEN', 'Un Volvo pequeño pero con un gran carácter', 'Diseñado para sorprenderle cada día, con toda la inspiración que necesita para disfrutar conduciendo por la ciudad o en una escapada de fin de semana.', 'v40_header.jpg', 0, ''),
(8, 8, 'VOLVO S80 MADE BY SWEDEN', 'Una declaración de intenciones', '', 's80_header.jpg', 0, ''),
(9, 9, 'VOLVO S60 CROSS COUNTRY MADE BY SWEDEN', 'No hay camino malo', 'Lujo sueco con espíritu aventurero, en una berlina que brilla con luz propia.', 's60cc_header.jpg', 0, ''),
(10, 10, 'VOLVO S60 MADE BY SWEDEN', 'El placer de conducir', 'Maniobrabilidad perfecta, conducción dinámica y natural, y el confort marca de la casa, además de unas líneas tan elegantes como seductoras.', 's60_header.jpg', 0, '');
