INSERT INTO `lp_modelos` (`id`, `categoria_modelo_id`, `marca_id`, `nombre`, `nombre_corto`, `nombre_menu`, `titulo`, `descripcion`, `imagen_1`, `imagen_2`, `boton`, `ficha_tecnica`) VALUES
(1, NULL, 1, 'Volvo all new xc90', 'xc-90', '<span>nuevo</span> XC90', 'Arte en Movimiento', 'La armonía reina en todos los elementos, elaborados con los materiales más exclusivos, como cuero suave y madera natural. Y también en los detalles más sofisticados, como una palanca de cambios con pomo de cristal y asientos delanteros refrigerados, con perfil ergonómico, funciones de masaje y apoyo lumbar eléctrico de cuatro puntos.', 'xc90_banner_galeria.jpg', 'xc90_footer.jpg', 'http://www.volvocars.com/cl/modelos/new-models/nuevo-xc90', 'documento_de_pruebas.pdf'),
(2, NULL, 1, 'Volvo XC70', 'volvo-xc70', 'XC70', 'Un regalo para los sentidos', 'En su XC70, todos los detalles que le rodean están pensados al milímetro, como los asientos delanteros ergonómicos de gran tamaño, el generoso espacio para las piernas o el volante térmico.\r\nY para los más exigentes, nuestro paquete Inscription ofrece un diseño todavía más trabajado, con paneles de nogal de fibra de alta densidad y cuero auténtico de vacuno.\r\n', 'xc70_banner_galeria.jpg', 'xc70r_footer.jpg', 'http://www.volvocars.com/cl/modelos/new-models/xc70', ''),
(3, NULL, 1, 'VOLVO XC60', 'volvo-xc60', 'XC 60', 'Todo el control en sus manos', '¿Malas carreteras? ¿Mal tiempo? No se preocupe, el XC60 está preparado. Con prestaciones como la tracción en las cuatro ruedas, el sistema Hill Descent Control y la asistencia al arranque en pendientes, siempre podrá contar con un empujoncito extra cuando lo necesite.', 'xc60_banner_galeria.jpg', 'xc60_footer.jpg', 'http://www.volvocars.com/cl/modelos/new-models/xc60', ''),
(4, NULL, 1, 'VOLVO V60 CROSS COUNTRY', 'volvo-v60-cross-country', 'V 60 <span>Cross Country</span>', 'El rey de los caminos imposibles', 'Con el V60 Cross Country, no hay carretera mala. Gracias a su gran altura al suelo, puede lidiar con cualquier tipo de superficie, haga el tiempo que haga, especialmente el modelo con tracción en las cuatro ruedas. \r\n\r\nY en la autopista, en los virajes a alta velocidad, y gracias al Control de Tracción en Curvas, su viaje será mucho más que una simple experiencia de conducción.\r\n', 'v60cc_banner_galeria.jpg', 'v60cc_footer.jpg', 'http://www.volvocars.com/cl/modelos/new-models/v60-cross-country', ''),
(5, NULL, 1, 'VOLVO V60', 'v-60', 'V 60', 'Potencia a discreción', 'El V60 es un auténtico regalo para los amantes de la velocidad y la potencia... y para los amantes del ahorro.\r\n\r\nSu motor de cuatro cilindros ruge con la misma potencia que uno de seis u ocho. Y los mandos de cambio de marcha del volante permiten cambiar manualmente con total precisión y comodidad.\r\n', 'v60_banner_galeria.jpg', 'v60_footer.jpg', 'http://www.volvocars.com/cl/modelos/new-models/v60', ''),
(6, NULL, 1, 'VOLVO V40 CROSS COUNTRY', 'volvo-v40-cross-country', 'V 40 <span>CROSS COUNTRY</span>', 'Fuerza interior con detalles de lujo', 'Con una suspensión elevada, llantas de 19 pulgadas, embellecedores de protección y asientos delanteros ergonómicos de gran tamaño, el V40 Cross Country es un coche nacido para ver mundo.', 'v40cc_banner_galeria.jpg', 'v40cc_footer.jpg', 'http://www.volvocars.com/cl/modelos/new-models/v40-cross-country', ''),
(7, NULL, 1, 'VOLVO V40', 'volvo-v40', 'v 40', 'Una conducción de auténtico lujo', 'Todos los detalles del V40 se han optimizado para ofrecerle un estilo de conducción deportivo y equilibrado, sin renunciar a un gran nivel de confort.<br>\r\nY además incorpora una suspensión avanzada y una dirección de gran precisión, aparte de nuestros nuevos motores Drive-E, que con sus cuatro cilindros proporcionan la misma potencia que uno de seis u ocho, pero con un consumo inferior.\r\n', 'v40_banner_galeria.jpg', 'v40_footer.jpg', 'http://www.volvocars.com/cl/modelos/new-models/v40', ''),
(8, NULL, 1, 'VOLVO S80', 'volvo-s80', 'S 80', 'El lujo sereno', 'Póngase cómodo y disfrute de su universo urbano en su confortable S80, con su interior de cuero suave, su generoso espacio para las piernas y sus asientos delanteros refrigerados y totalmente anatómicos.', 's80_banner_galeria.jpg', 's80_footer.jpg', 'http://www.volvocars.com/cl/modelos/new-models/s80', ''),
(9, NULL, 1, 'VOLVO S60 CROSS COUNTRY', 'volvo-s60-cross-country', 'S 60 <span>CROSS COUNTRY</span>', 'Poderosa presencia', 'El S60 Cross Country luce un porte imponente, musculoso, fiel reflejo de su naturaleza indomable. Los tubos de escape integrados son un guiño a su lado más deportivo, mientras que el espacioso interior de cuero, con sus asientos deportivos ergonómicos, es el mejor ejemplo de un lujo sin complejos.', 's60cc_banner_galeria.jpg', 's60cc_footer.jpg', 'http://www.volvocars.com/cl/modelos/new-models/s60-cross-country', ''),
(10, NULL, 1, 'VOLVO S60', 'volvo-s60', 'S 60', 'Una experiencia al volante de otra dimensión', 'El S60 dispone de suspensión avanzada, dirección de gran precisión y mandos de cambio de marcha en el volante, para cambiar manualmente con total precisión y comodidad.<br>\r\nY con el chasis Four-C, puede elegir entre 3 modos de conducción diferentes simplemente tocando un botón, en función de su estado de ánimo, su estilo o la carretera.\r\n', 's60_banner_galeria.jpg', 's60_footer.jpg', 'http://www.volvocars.com/cl/modelos/new-models/s60', '');
